  Queensland University of Technology.
  02> DUGDALE, Susan Mary
  b 14.12.1958
  Susan b. at Dunedin, Address: 27 Giles Street, Alice Springs, NT, Australia.
  Susan attended Indooroopilly High School, Queensland, and has a B Architecture (RMIT) Victoria and
  BDesst from University of Queensland. She is a registered architect and was a part-time lecturer at
  the Royal Melbourne Institute of Technology. She is now managing architect at the Tangentyere
  Council, Alice Springs.
  03> DUGDALE, Brett Ellis m on 01.11.1997 to QUINN, Eimear
  b 24.03.1960
  b 26.05.1964
  Brett b. at Perth, Western Australia. Address: 10 Dunstan Street, Moorooka 4105, Qld, Australia,
  Brett attended Toowoomba Grammar School and Indooroopilly High School, Queensland, and is a
  telecommunications technician and an amateur motorbike racer.
  64> DUGDALE, Megan Vera
  b 24.01.1963
  Megan b. at Perth, Western Australia. Address: 71 McCaul Street, Taringa 4068, QInd, Australia.
  Megan attended Indooroopilly High School, Queensland and has a B Applied Science (Built
  Environment) and a BArch (QUT). She is an architect/project manager with Austotel, Sydney.
  04> SEWELL, Bernard Malcolm m on 04.01.1958 to GARDINER, Lexia Merle
  b 09.04.1932 d 18.12.1981
  b 22.12.1929 d 17.07.1995
  Bernard b. at Gisborne and m. at St Andrew's Presbyterian Church, Gisborne. Merie, dlo Reginald Keith
  Gardiner and Florence Madeline Witty. Both cremated and ashes lodged at the Taranaki Crematorium.
  Bernard was educated at Dilworth School, Auckland and Gisborne High School. He was a dairy farmer in
  Taranaki, starting off on the demonstration farm at Midhurst before buying a farm at Omata. In 1988 he
  moved to New Plymouth and worked for the New Plymouth Electricity Department as a draftsman. He was an
  elder of the Presbyterian Church. He was also a keen actor in amateur theatricals and a past-president
  of the Little Theatre Society in New Plymouth.
  Merle was a primary school teacher at Gisborne and New Plymouth. She grew up in Oamaru and attended
  Waitaki Girls' High School before completing her schooling at Gisborne and teacher training at
  Wellington. She set up a branch of Counterstroke in New Plymouth in the mid 1980s, along with a
  library in her then local church, St Andrew's, New Plymouth. Her other interests were piano playing,
  oil and watercolour painting, gardening and reading.
  01> SEWELL, Kenneth Malcolm m on 24.10.1987 to BROSNAN, Judith Anne
  b 30.12.1958
  b 19.11.1961
  Kenneth b. at Stratford and m, at St Andrew's Presbyterian Church, New Plymouth. Judith b. at
  Dannevirke. Address: 74 Cumberland Street, New Plymouth.
  Kenneth is salesperson and Judith was a factory hand before marriage. Kenneth participated in a
  Youth Exchange to Japan, Kenneth now works at Toops Wholesale and at Pizza Hut. Judith looks
  after Barnados children.
  01> SEWELL, Alexander James
  b 04.12.1990
  Alexander b. at New Plymouth.
